    const [value, setvalue] = useState(0)
    useEffect(function(){
        console.log("side effect performed");

    },[value])
    function incr(){
        setvalue(value+1)
    }
  return (
    <div>
       <h1>hfgdfg</h1>
       <button onClick={function(){
        incr()
       }}>change value</button>
    </div>
  )
}

export default A
